adedNamespace;ta.loadNamespaces;ta.loadLanguages;const GT={home:{header:"<span>Hello.<br /> I'm Brian Velasquez,<br /><em>Senior Full Stack <br />Engineer.</em></span>",aboutHeader:"Who am I?",about:"Senior Full-Stack Web Developer with expertise in TypeScript, React, Angular, Node.js, and Python. Experienced in leading international teams, modernizing legacy systems, optimizing architectures, and implementing CI/CD pipelines for efficient deployment. Passionate about building scalable, user-centric solutions that drive business growth.",section1Title:"Experienced",section1Content1:"In my most recent role as a Senior Full-Stack Developer at pharmaceutical tech startup Faro Health, I built and optimized REST and CQRS-based microservices and UI modules using TypeScript, Node.js, PostgreSQL, Jest, and React. I developed feature slices and POCs, designed and executed technical solutions, wrote unit and integration tests, optimized application performance, and built deployment pipelines with GitHub Actions.",section1Content2:"Previously, I led an international remote front-end team at Various Inc., collaborating closely with designers to modernize legacy JavaScript and Perl-based video streaming apps. We migrated them to a scalable, high-performance React and TypeScript stack with Next.js, MOBX, WebSockets, and Python, backed by REST APIs and a CI/CD pipeline for seamless deployment.",section2Title:"Technical Leader",section2Content1:"Having led a large international team across the US, Europe, Taiwan, and China, I bring deep expertise in TypeScript, Node.js, PostgreSQL, Jest, and React to drive innovation. Beyond technical design and development, my leadership skills ensure teams stay aligned, focused, and working toward key milestones and company goals."},about:{section1:"Brian is an experienced Senior Developer with a passion for elegant scalable code, and minimal intuitive UX.",section2:"In his spare time he loves to climb, play chess, explore on his dirtbike, and practice Muay Thai."},lang:{english:"English",chinese:"Chinese",espanol:"Espanol",thai:"Thai",german:"German",korean:"Korean"},nav:{home:"Home",skills:"Skills",projects:"Projects",about:"About",jobs:"Jobs"},jobs:{content:{1:"",2:"",3:"",4:"",5:""}},data:{projects:{description:{1:"A clinical trial software tool for planning, designing and optimizing studies with real-time analytics",2:"A realtime video streaming and chat application",3:"A survey and informational website about upcoming changes to for the city of San Anselmo",4:"Website for a web design and development agency",5:"Proof of concept Data Analytics micro-service app built in Python and Pandas",6:"An IDP agnostic Single Sign On implementation for the study designer application",7:"Website for a AI used car application",8:"Front end for a showcase application for a Geometric application for combining lattice structures"},content:{1:"<div><h3>Utilizing AI for clinical study development.</h3><p>The company's flagship product, the Faro Study Designer, is designed to enhance the efficiency and patient-friendliness of clinical protocols.</p><p>Faro Health has received significant investment, securing a total of $38.3 million in funding, with the most recent $20 million raised approximately two years ago.</p><p>Key features include:</p><ul><li>Real-time Collaboration: Facilitates accurate and efficient documentation processes.</li><li>Feasibility Analysis: Assesses the impact of design decisions on study success rates.</li><li>Benchmarking: Compares protocols with historical data and design variations.</li></ul></div>",2:"<p>The Viewer is an interactive webcam platform where users can engage in live video chats with performers, offering a real-time, personalized experience. The platform allows users to view live broadcasts, participate in private sessions, and connect with performers through video, audio, and chat features. </p> ",3:"<p>A wordpress website for the The 2025 San Anselmo General Plan Update which provides residents with comprehensive information on proposed changes to the town's infrastructure, zoning, and public spaces. It features detailed project updates, sustainability initiatives, and transportation improvements. The site also includes interactive public surveys, allowing community members to provide feedback and participate in the decision-making process.</p>",4:"<p>Launch Brigade is a web design and development agency based in the San Francisco Bay Area, specializing in creating digital experiences that elevate brands and drive business growth. Their website, launchbrigade.com, reflects their commitment to delivering comprehensive digital solutions.</p>",5:"<p>The Data Analytics Dashboard was a proof of concept application built in Pandas which utilized Study Design data stored in a star schema to create a data analytics microservice and frontend. This app allowed users to slice and dice their study data according to whatever data dimensions they chose.</p>",6:"<p>An IDP agnostic Single Sign On implementation for the study designer application. Built to allow interchangeable organizations to use their own SAML and Oauth identity provider services to provide tokens for interacting with our api.<p>",7:"<p>Lotlinx is an AI-driven automotive inventory management platform that leverages machine learning and extensive data analytics to help dealerships optimize inventory turnover and profitability. By providing real-time insights into market demand, pricing strategies, and consumer behavior, Lotlinx enables use car dealers to make data-driven decisions, reduce holding costs, and enhance overall operational efficiency.</p>",8:"<p>​Metafold 3D is a cloud-based platform that enables the design and engineering of highly complex 3D models, specifically optimized for additive manufacturing. Founded in 2020 by experts in mathematics, geometry, and architecture, Metafold addresses the challenges traditional CAD tools face when handling intricate geometries, such as lattice structures, which are essential for lightweight and efficient designs​Metafold 3D is a cloud-based platform that enables the design and engineering of highly complex 3D models, specifically optimized for additive manufacturing. Metafold addresses the challenges traditional CAD tools face when handling merging intricate geometries, such as lattice structures.</p>"}},jobs:{title:{1:"Senior Full-Stack Developer",2:"Senior Lead Front-end Developer",3:"Front-end Developer",4:"Front-end Developer Intern",5:"Designer Intern"}}}},YT={translation:GT},XT={home:{header:"<span>¡Hola!<br /> Soy Brian Velasquez,<br /><em>Ingeniero Senior Full Stack</em></span>",aboutHeader:"¿Quién soy?",about:"Desarrollador web Full-Stack Senior con experiencia en TypeScript, React, Angular, Node.js y Python. Experiencia liderando equipos internacionales, modernizando sistemas heredados, optimizando arquitecturas e implementando pipelines de CI/CD para despliegues eficientes. Apasionado por construir soluciones escalables y centradas en el usuario que impulsen el crecimiento empresarial.",section1Title:"Experimentado",section1Content1:"En mi rol más reciente como Desarrollador Full-Stack Senior en la startup farmacéutica Faro Health, construí y optimicé microservicios basados en REST y CQRS, así como módulos de interfaz de usuario utilizando TypeScript, Node.js, PostgreSQL, Jest y React. Desarrollé fragmentos de características y pruebas de concepto, diseñé y ejecuté soluciones técnicas, escribí pruebas unitarias y de integración, optimicé el rendimiento de la aplicación y construí pipelines de despliegue con GitHub Actions.",section1Content2:"Anteriormente, lideré un equipo remoto internacional de front-end en Various Inc., colaborando estrechamente con diseñadores para modernizar aplicaciones de transmisión de video basadas en JavaScript y Perl. Migramos estas aplicaciones a una pila escalable y de alto rendimiento con React, TypeScript, Next.js, MOBX, WebSockets y Python, respaldada por APIs REST y un pipeline de CI/CD para despliegues sin problemas.",section2Title:"Líder Técnico",section2Content1:"Habiendo liderado un equipo internacional extenso en EE.UU., Europa, Taiwán y China, aporto una profunda experiencia en TypeScript, Node.js, PostgreSQL, Jest y React para impulsar la innovación. Más allá del diseño y desarrollo técnico, mis habilidades de liderazgo aseguran que los equipos se mantengan alineados, enfocados y trabajando hacia los hitos clave y los objetivos de la empresa."},about:{section1:"Brian es un desarrollador senior experimentado con pasión por el código escalable y elegante y las experiencias de usuario mínimas e intuitivas.",section2:"En su tiempo libre le encanta escalar, jugar al ajedrez, explorar en su moto de cross y practicar Muay Thai."},lang:{english:"Inglés",chinese:"Chino",espanol:"Español",thai:"Tailandés",german:"Alemán",korean:"Coreano"},nav:{home:"Inicio",skills:"Habilidades",projects:"Proyectos",about:"Acerca de",jobs:"Trabajos"},jobs:{content:{1:"",2:"",3:"",4:"",5:""}},data:{projects:{description:{1:"Una herramienta de software para ensayos clínicos para planificar, diseñar y optimizar estudios con análisis en tiempo real.",2:"Una aplicación de transmisión de video en tiempo real y chat.",3:"Un sitio web de encuestas e información sobre los próximos cambios para la ciudad de San Anselmo.",4:"Sitio web para una agencia de diseño y desarrollo web.",5:"Prueba de concepto de una aplicación microservicio de análisis de datos construida en Python y Pandas.",6:"Una implementación de inicio de sesión único (SSO) independiente del proveedor de identidad (IDP) para la aplicación de diseño de estudios.",7:"Sitio web para una aplicación de autos usados basada en IA.",8:"Interfaz de usuario para una aplicación de demostración de una aplicación geométrica para combinar estructuras de celosía."},content:{1:"<div><h3>Utilización de IA para el desarrollo de estudios clínicos.</h3><p>El producto insignia de la compañía, Faro Study Designer, está diseñado para mejorar la eficiencia y la experiencia del paciente en los protocolos clínicos.</p><p>Faro Health ha recibido una inversión significativa, asegurando un total de $38.3 millones, con $20 millones recaudados hace aproximadamente dos años.</p><p>Características clave incluyen:</p><ul><li>Colaboración en tiempo real: Facilita procesos de documentación precisos y eficientes.</li><li>Análisis de factibilidad: Evalúa el impacto de las decisiones de diseño en las tasas de éxito del estudio.</li><li>Benchmarking: Compara protocolos con datos históricos y variaciones de diseño.</li></ul></div>",2:"<p>El Viewer es una plataforma interactiva de cámaras web donde los usuarios pueden participar en chats de video en vivo con los presentadores, ofreciendo una experiencia personalizada y en tiempo real. La plataforma permite ver transmisiones en vivo, participar en sesiones privadas y conectarse a través de video, audio y chat.</p>",3:"<p>Un sitio web en WordPress para la Actualización del Plan General 2025 de San Anselmo, que brinda a los residentes información detallada sobre los cambios propuestos en la infraestructura, la zonificación y los espacios públicos de la ciudad. También incluye encuestas interactivas para recopilar opiniones de la comunidad.</p>",4:"<p>Launch Brigade es una agencia de diseño y desarrollo web con sede en el Área de la Bahía de San Francisco, especializada en crear experiencias digitales que mejoran las marcas y fomentan el crecimiento empresarial. Su sitio web, launchbrigade.com, refleja su compromiso con soluciones digitales integrales.</p>",5:"<p>El Panel de Análisis de Datos fue una prueba de concepto construida en Pandas que utilizaba datos de diseño de estudios almacenados en un esquema estrella para crear un microservicio de análisis de datos y frontend. Este app permitía a los usuarios segmentar y analizar sus datos de estudio según las dimensiones elegidas.</p>"}}}},KT={translation:XT},QT={home:{header:"<span>你好！<br /> 我是 Brian Velasquez,<br /><em>高级全栈工程师 <br />+ 自由职业者。</em></span>",aboutHeader:"我是谁？",about:"高级全栈 Web 开发人员，精通 TypeScript、React、Angular、Node.js 和 Python。具有领导国际团队、现代化遗留系统、优化架构以及实现 CI/CD 流水线以提高部署效率的经验。热衷于构建可扩展的、以用户为中心的解决方案，推动业务增长。",section1Title:"经验丰富",section1Content1:"在我最近的职位中，作为制药科技初创公司 Faro Health 的高级全栈开发人员，我使用 TypeScript、Node.js、PostgreSQL、Jest 和 React 构建并优化了基于 REST 和 CQRS 的微服务和 UI 模块。我开发了功能切片和 POC，设计并执行了技术解决方案，编写了单元测试和集成测试，优化了应用性能，并使用 GitHub Actions 构建了部署流水线。",section1Content2:"之前，我在 Various Inc. 领导了一个国际远程前端团队，与设计师紧密合作，将基于 JavaScript 和 Perl 的视频流应用程序现代化。我们将其迁移到一个可扩展的、高性能的 React 和 TypeScript 堆栈，使用 Next.js、MOBX、WebSockets 和 Python，并通过 REST API 和 CI/CD 流水线支持无缝部署。",section2Title:"技术领导",section2Content1:"我曾领导过一个横跨美国、欧洲、台湾和中国的大型国际团队，带来了深入的 TypeScript、Node.js、PostgreSQL、Jest 和 React 专业知识，以推动创新。除了技术设计和开发，我的领导能力确保团队保持一致、专注，并朝着关键里程碑和公司目标努力。"},about:{section1:"Brian 是一位经验丰富的高级开发人员，热衷于编写优雅、可扩展的代码，并致力于最小化直观的用户体验。",section2:"在业余时间，他喜欢攀岩、下棋、骑越野摩托车探险和练习泰拳。"},lang:{english:"英语",chinese:"中文",espanol:"西班牙语",thai:"泰语",german:"德语",korean:"韩语"},nav:{home:"主页",skills:"技能",projects:"项目",about:"关于",jobs:"职位"},jobs:{content:{1:"",2:"",3:"",4:"",5:""}},data:{projects:{description:{1:"一种用于临床试验的软件工具，用于规划、设计和优化研究并提供实时分析",2:"一个实时视频流和聊天应用程序",3:"关于即将发生的变化的调查和信息网站，针对圣安塞尔莫市",4:"一家网页设计和开发机构的官网",5:"使用 Python 和 Pandas 构建的数据分析微服务应用的概念验证",6:"一个与 IDP 无关的单点登录实现，用于研究设计应用程序",7:"一家人工智能二手车应用的官网",8:"一个展示几何应用程序的前端，用于组合格栅结构"},content:{1:"<div><h3>利用人工智能推动临床研究开发。</h3><p>公司的旗舰产品 Faro Study Designer 旨在提高临床协议的效率和患者友好性。</p><p>Faro Health 已获得重大投资，累计筹集了 3830 万美元的资金，最近一轮 2000 万美元的融资约在两年前完成。</p><p>主要特点包括：</p><ul><li>实时协作：促进准确高效的文档处理过程。</li><li>可行性分析：评估设计决策对研究成功率的影响。</li><li>基准测试：将协议与历史数据和设计变体进行比较。</li></ul></div>",2:"<p>The Viewer 是一个互动网络摄像头平台，用户可以与表演者进行实时视频聊天，提供个性化的体验。该平台允许用户观看直播、参加私人会议并通过视频、音频和聊天功能与表演者互动。</p>",3:"<p>2025 年圣安塞尔莫综合规划更新的 WordPress 网站，提供给居民关于该市基础设施、分区和公共空间变动的全面信息。该网站包含详细的项目更新、可持续发展举措和交通改进。该网站还包括互动公共调查，允许社区成员提供反馈并参与决策过程。</p>",4:"<p>Launch Brigade 是一家位于旧金山湾区的网页设计和开发机构，专注于创建提升品牌并推动业务增长的数字体验。他们的网站 launchbrigade.com 体现了他们提供全面数字解决方案的承诺。</p>",5:"<p>数据分析仪表板是一个概念验证应用，使用 Pandas 构建，利用存储在星型架构中的研究设计数据，创建了一个数据分析微服务和前端。该应用允许用户根据选择的数据维度切分和分析其研究数据。</p>",6:"<p>这是一个与 IDP 无关的单点登录实现，用于研究设计应用程序。旨在允许不同的组织使用自己的 SAML 和 Oauth 身份提供者服务提供令牌，以便与我们的 API 进行交互。</p>",7:"<p>Lotlinx 是一个由人工智能驱动的汽车库存管理平台，利用机器学习和广泛的数据分析帮助经销商优化库存周转和盈利能力。通过提供市场需求、定价策略和消费者行为的实时洞察，Lotlinx 帮助二手车经销商做出数据驱动的决策，降低库存成本，并提高整体运营效率。</p>",8:"<p>Metafold 3D 是一个基于云的平台，能够设计和工程化高度复杂的 3D 模型，专门优化用于增材制造。Metafold 于 2020 年由数学、几何和建筑学专家创立，解决了传统 CAD 工具在处理复杂几何形状（如格栅结构）时面临的挑战，这些结构对于轻质和高效的设计至关重要。</p>"}},jobs:{title:{1:"高级全栈开发人员",2:"高级前端开发主管",3:"前端开发人员",4:"前端开发实习生",5:"设计实习生"}}}},ZT={translation:QT},WT={home:{header:"<span>Hallo!<br /> Ich bin Brian Velasquez,<br /><em>Senior Full Stack <br />Engineer.</em></span>",aboutHeader:"Wer bin ich?",about:"Senior Full-Stack Web-Entwickler mit Expertise in TypeScript, React, Angular, Node.js und Python. Erfahren in der Führung internationaler Teams, der Modernisierung von Altsystemen, der Optimierung von Architekturen und der Implementierung von CI/CD-Pipelines für eine effiziente Bereitstellung. Leidenschaftlich darin, skalierbare, benutzerzentrierte Lösungen zu bauen, die das Geschäftswachstum vorantreiben.",section1Title:"Erfahren",section1Content1:"In meiner letzten Rolle als Senior Full-Stack Developer bei dem Pharma-Tech-Startup Faro Health habe ich REST- und CQRS-basierte Microservices und UI-Module mit TypeScript, Node.js, PostgreSQL, Jest und React entwickelt und optimiert. Ich habe Feature-Slices und POCs entwickelt, technische Lösungen entworfen und ausgeführt, Unit- und Integrationstests geschrieben, die Anwendungsleistung optimiert und Deployment-Pipelines mit GitHub Actions aufgebaut.",section1Content2:"Zuvor habe ich ein internationales Remote-Front-End-Team bei Various Inc. geleitet und eng mit Designern zusammengearbeitet, um eine alte JavaScript- und Perl-basierte Video-Streaming-App zu modernisieren. Wir migrierten sie auf einen skalierbaren, leistungsstarken React- und TypeScript-Stack mit Next.js, MOBX, WebSockets und Python, unterstützt von REST-APIs und einer CI/CD-Pipeline für eine nahtlose Bereitstellung.",section2Title:"Technischer Leiter",section2Content1:"Nachdem ich ein großes internationales Team in den USA, Europa, Taiwan und China geleitet habe, bringe ich tiefgehende Expertise in TypeScript, Node.js, PostgreSQL, Jest und React mit, um Innovationen voranzutreiben. Neben technischer Gestaltung und Entwicklung sorgen meine Führungsfähigkeiten dafür, dass Teams fokussiert bleiben und auf wichtige Meilensteine und Unternehmensziele hinarbeiten."},about:{section1:"Brian ist ein erfahrener Senior Developer mit einer Leidenschaft für eleganten, skalierbaren Code und minimalistische, intuitive UX.",section2:"In seiner Freizeit liebt er es, zu klettern, Schach zu spielen, mit seinem Dirtbike zu fahren und Muay Thai zu üben."},lang:{english:"Englisch",chinese:"Chinesisch",espanol:"Spanisch",thai:"Thailändisch",german:"Deutsch",korean:"Koreanisch"},nav:{home:"Startseite",skills:"Fähigkeiten",projects:"Projekte",about:"Über mich",jobs:"Jobs"},jobs:{content:{1:"",2:"",3:"",4:"",5:""}},data:{projects:{description:{1:"Ein Softwaretool für klinische Studien zur Planung, Gestaltung und Optimierung von Studien mit Echtzeit-Analysen",2:"Eine Echtzeit-Video-Streaming- und Chat-Anwendung",3:"Eine Umfrage- und Informationswebsite zu bevorstehenden Änderungen in der Stadt San Anselmo",4:"Website für eine Webdesign- und Entwicklungsagentur",5:"Proof of Concept Data Analytics Micro-Service-App, erstellt in Python und Pandas",6:"Eine IDP-unabhängige Single Sign-On-Implementierung für die Study Designer-Anwendung",7:"Website für eine KI-basierte Gebrauchtwagen-App",8:"Frontend für eine Showcase-Anwendung einer geometrischen Anwendung zur Kombination von Gitterstrukturen"},content:{1:"<div><h3>AI für die klinische Studienentwicklung nutzen</h3><p>Das Hauptprodukt des Unternehmens, der Faro Study Designer, wurde entwickelt, um die Effizienz und Benutzerfreundlichkeit klinischer Protokolle zu verbessern.</p><p>Faro Health hat erhebliche Investitionen erhalten und insgesamt 38,3 Millionen Dollar an Finanzmitteln gesichert, wobei die letzte Finanzierungsrunde von 20 Millionen Dollar vor etwa zwei Jahren abgeschlossen wurde.</p><p>Zu den wichtigsten Funktionen gehören:</p><ul><li>Echtzeit-Zusammenarbeit: Erleichtert präzise und effiziente Dokumentationsprozesse.</li><li>Machbarkeitsanalyse: Bewertet die Auswirkungen von Designentscheidungen auf die Erfolgsraten von Studien.</li><li>Benchmarking: Vergleicht Protokolle mit historischen Daten und Designvariationen.</li></ul></div>",2:"<p>The Viewer ist eine interaktive Webcam-Plattform, auf der Benutzer in Echtzeit mit Darstellern in Video-Chats interagieren können. Die Plattform ermöglicht es den Nutzern, Live-Übertragungen zu sehen, an privaten Sitzungen teilzunehmen und mit den Darstellern über Video, Audio und Chat-Funktionen zu kommunizieren.</p>",3:"<p>Eine WordPress-Website für das San Anselmo General Plan Update 2025, die den Anwohnern umfassende Informationen zu den vorgeschlagenen Änderungen an der städtischen Infrastruktur, Zoneneinteilung und öffentlichen Räumen bietet. Sie enthält detaillierte Projektupdates, Nachhaltigkeitsinitiativen und Verbesserungen im Bereich Transport. Die Seite umfasst auch interaktive öffentliche Umfragen, die es den Bürgern ermöglichen, Feedback zu geben und sich am Entscheidungsprozess zu beteiligen.</p>",4:"<p>Launch Brigade ist eine Webdesign- und Entwicklungsagentur mit Sitz im San Francisco Bay Area, die sich darauf spezialisiert hat, digitale Erlebnisse zu schaffen, die Marken stärken und das Geschäftswachstum fördern. Ihre Website, launchbrigade.com, spiegelt ihr Engagement wider, umfassende digitale Lösungen anzubieten.</p>",5:"<p>Das Data Analytics Dashboard war eine Proof-of-Concept-Anwendung, die in Pandas entwickelt wurde und Studiendaten im Star-Schema verwendete, um einen Data Analytics Micro-Service und Frontend zu erstellen. Diese App ermöglichte es den Nutzern, ihre Studiendaten nach beliebigen Daten-Dimensionen zu analysieren.</p>",6:"<p>Eine IDP-unabhängige Single Sign-On-Implementierung für die Study Designer-Anwendung. Diese wurde entwickelt, um es verschiedenen Organisationen zu ermöglichen, ihre eigenen SAML- und OAuth-Identity-Provider-Dienste zu nutzen, um Tokens für die Interaktion mit unserer API bereitzustellen.</p>",7:"<p>Lotlinx ist eine KI-gesteuerte Plattform zur Verwaltung von Auto-Inventar, die maschinelles Lernen und umfangreiche Datenanalyse nutzt, um Autohändlern zu helfen, den Lagerumschlag und die Rentabilität zu optimieren. Durch Echtzeit-Einblicke in Marktnachfrage, Preisstrategien und Verbraucherverhalten ermöglicht Lotlinx Gebrauchtwagenhändlern, datengestützte Entscheidungen zu treffen, die Lagerkosten zu senken und die Betriebseffizienz zu steigern.</p>",8:"<p>Metafold 3D ist eine cloudbasierte Plattform, die das Design und Engineering von hochkomplexen 3D-Modellen ermöglicht, die speziell für die additive Fertigung optimiert sind. Metafold wurde 2020 von Experten in Mathematik, Geometrie und Architektur gegründet und adressiert die Herausforderungen, die traditionelle CAD-Tools bei der Handhabung komplexer Geometrien wie Gitterstrukturen haben, die für leichte und effiziente Designs unerlässlich sind.</p>"}},jobs:{title:{1:"Senior Full-Stack Developer",2:"Senior Lead Front-End Developer",3:"Front-End Developer",4:"Front-End Developer Praktikant",5:"Design Praktikant"}}}},JT={translation:WT},eD={home:{header:"<span>안녕하세요!<br /> 저는 Brian Velasquez입니다,<br /><em>시니어 풀 스택 <br />엔지니어.</em></span>",aboutHeader:"저는 누구인가요?",about:"TypeScript, React, Angular, Node.js, Python에 전문성을 가진 시니어 풀 스택 웹 개발자입니다. 국제 팀을 이끌고, 레거시 시스템을 현대화하며, 아키텍처를 최적화하고, 효율적인 배포를 위한 CI/CD 파이프라인을 구현한 경험이 있습니다. 비즈니스 성장을 이끄는 확장 가능하고 사용자 중심의 솔루션을 만드는 데 열정적입니다.",section1Title:"경험",section1Content1:"최근에 제약 기술 스타트업인 Faro Health에서 시니어 풀 스택 개발자로 일하면서 TypeScript, Node.js, PostgreSQL, Jest, React를 사용하여 REST와 CQRS 기반의 마이크로서비스와 UI 모듈을 구축하고 최적화했습니다. 기능 조각과 POC를 개발하고, 기술 솔루션을 설계하고 실행했으며, 단위 테스트와 통합 테스트를 작성하고, 애플리케이션 성능을 최적화하고, GitHub Actions로 배포 파이프라인을 구축했습니다.",section1Content2:"그 이전에는 Various Inc.에서 국제 원격 프론트엔드 팀을 이끌며 디자이너들과 밀접하게 협력하여 레거시 JavaScript 및 Perl 기반의 비디오 스트리밍 앱을 현대화했습니다. 우리는 이를 Next.js, MOBX, WebSockets, Python을 사용하는 확장 가능하고 고성능의 React 및 TypeScript 스택으로 마이그레이션했으며, REST API와 CI/CD 파이프라인으로 원활한 배포를 지원했습니다.",section2Title:"기술 리더",section2Content1:"미국, 유럽, 대만, 중국에 걸친 큰 국제 팀을 이끈 경험을 통해 TypeScript, Node.js, PostgreSQL, Jest, React에 대한 깊은 전문 지식을 보유하고 있으며, 이를 통해 혁신을 이끌어 냈습니다. 기술 설계와 개발을 넘어서 제 리더십 역량은 팀이 목표와 회사의 주요 성과를 향해 집중하고 일관되게 나아가도록 합니다."},about:{section1:"Brian은 우아하고 확장 가능한 코드와 직관적인 UX에 열정을 가진 경험 많은 시니어 개발자입니다.",section2:"여가 시간에는 암벽 등반, 체스, 오프로드 바이크 탐험, 태국 무술을 연습하는 것을 좋아합니다."},lang:{english:"영어",chinese:"중국어",espanol:"스페인어",thai:"태국어",german:"독일어",korean:"한국어"},nav:{home:"홈",skills:"기술",projects:"프로젝트",about:"소개",jobs:"직업"},jobs:{content:{1:"",2:"",3:"",4:"",5:""}},data:{projects:{description:{1:"실시간 분석을 통해 연구를 계획, 설계 및 최적화하는 임상 시험 소프트웨어 도구",2:"실시간 비디오 스트리밍 및 채팅 애플리케이션",3:"San Anselmo 시의 다가오는 변경 사항에 대한 설문조사 및 정보 웹사이트",4:"웹 디자인 및 개발 에이전시의 웹사이트",5:"Python과 Pandas로 구축된 데이터 분석 마이크로서비스 앱의 개념 증명",6:"연구 디자이너 애플리케이션을 위한 IDP 독립적인 단일 로그인 구현",7:"AI 중고차 애플리케이션의 웹사이트",8:"격자 구조 결합을 위한 기하학적 애플리케이션의 쇼케이스 애플리케이션 전면"},content:{1:"<div><h3>임상 연구 개발을 위한 AI 활용</h3><p>회사의 대표적인 제품인 Faro Study Designer는 임상 프로토콜의 효율성과 환자 친화성을 향상시키기 위해 설계되었습니다.</p><p>Faro Health는 3830만 달러의 투자금을 확보했으며, 최근 약 2년 전에는 2000만 달러의 자금을 모집했습니다.</p><p>주요 기능은 다음과 같습니다:</p><ul><li>실시간 협업: 정확하고 효율적인 문서화 프로세스를 촉진합니다.</li><li>타당성 분석: 설계 결정이 연구 성공률에 미치는 영향을 평가합니다.</li><li>벤치마킹: 프로토콜을 역사적 데이터 및 설계 변형과 비교합니다.</li></ul></div>",2:"<p>The Viewer는 사용자가 공연자와 실시간으로 비디오 채팅을 할 수 있는 인터랙티브한 웹캠 플랫폼으로, 실시간 맞춤형 경험을 제공합니다. 이 플랫폼은 사용자가 실시간 방송을 시청하고, 비공개 세션에 참여하며, 비디오, 오디오 및 채팅 기능을 통해 공연자와 소통할 수 있게 합니다.</p>",3:"<p>2025 San Anselmo 종합 계획 업데이트를 위한 WordPress 웹사이트로, 주민들에게 마을의 인프라, 구역 설정, 공공 공간에 대한 제안된 변경 사항에 대한 종합적인 정보를 제공합니다. 사이트는 프로젝트 업데이트, 지속 가능성 이니셔티브 및 교통 개선 사항을 포함하고 있으며, 주민들이 피드백을 제공하고 의사 결정 과정에 참여할 수 있는 인터랙티브한 공공 설문조사도 포함되어 있습니다.</p>",4:"<p>Launch Brigade는 브랜드를 향상시키고 비즈니스 성장을 촉진하는 디지털 경험을 만드는 데 전문화된 웹 디자인 및 개발 에이전시입니다. 그들의 웹사이트인 launchbrigade.com은 포괄적인 디지털 솔루션을 제공하는 데 대한 그들의 약속을 반영합니다.</p>",5:"<p>데이터 분석 대시보드는 Pandas로 구축된 개념 증명 애플리케이션으로, 별 모양의 구조에 저장된 연구 설계 데이터를 활용하여 데이터 분석 마이크로서비스 및 프론트엔드를 생성했습니다. 이 애플리케이션은 사용자가 선택한 데이터 차원에 따라 연구 데이터를 분할하고 분석할 수 있게 합니다.</p>",6:"<p>연구 디자이너 애플리케이션을 위한 IDP 독립적인 단일 로그인 구현입니다. 여러 조직이 SAML 및 Oauth 인증 공급자 서비스를 사용하여 우리 API와 상호 작용하기 위한 토큰을 제공할 수 있도록 구축되었습니다.</p>",7:"<p>Lotlinx는 AI 기반의 자동차 재고 관리 플랫폼으로, 기계 학습과 광범위한 데이터 분석을 활용하여 자동차 대리점이 재고 회전율과 수익성을 최적화할 수 있도록 돕습니다. 시장 수요, 가격 전략 및 소비자 행동에 대한 실시간 통찰력을 제공함으로써 중고차 대리점은 데이터 기반의 결정을 내리고, 보유 비용을 줄이며, 전체 운영 효율성을 향상시킬 수 있습니다.</p>",8:"<p>Metafold 3D는 복잡한 3D 모델을 설계하고 엔지니어링할 수 있게 해주는 클라우드 기반 플랫폼으로, 특히 부가 제조를 최적화하는 데 중점을 둡니다. 2020년에 수학, 기하학 및 건축 전문가들에 의해 설립된 Metafold는 전통적인 CAD 도구들이 복잡한 기하학적 구조를 처리하는 데 겪는 어려움을 해결하며, 특히 경량화 및 효율적인 설계를 위한 격자 구조를 다룹니다.</p>"}},jobs:{title:{1:"시니어 풀 스택 개발자",2:"시니어 프론트엔드 개발 리더",3:"프론트엔드 개발자",4:"프론트엔드 개발 인턴",5:"디자인 인턴"}}}},tD={translation:eD},nD={home:{header:"<span>สวัสดี!<br /> ฉันคือ Brian Velasquez,<br /><em>Senior Full Stack <br />Engineer.</em></span>",aboutHeader:"ฉันคือใคร?",about:"Senior Full-Stack Web Developer ที่มีความเชี่ยวชาญใน TypeScript, React, Angular, Node.js และ Python มีประสบการณ์ในการเป็นผู้นำทีมระหว่างประเทศ การพัฒนาระบบเก่าให้ทันสมัย การปรับปรุงสถาปัตยกรรม และการนำเสนอ CI/CD pipelines สำหรับการปรับใช้ที่มีประสิทธิภาพ มีความหลงใหลในการสร้างโซลูชันที่สามารถขยายได้และเน้นผู้ใช้ ซึ่งช่วยผลักดันการเติบโตของธุรกิจ",section1Title:"มีประสบการณ์",section1Content1:"ในตำแหน่งล่าสุดของฉันในฐานะ Senior Full-Stack Developer ที่ Faro Health สตาร์ทอัพทางเทคโนโลยีด้านเภสัชกรรม ฉันได้สร้างและปรับปรุง REST และ CQRS-based microservices และ UI modules โดยใช้ TypeScript, Node.js, PostgreSQL, Jest และ React ฉันได้พัฒนา feature slices และ POCs ออกแบบและดำเนินการแก้ปัญหาทางเทคนิค เขียนการทดสอบหน่วยและการทดสอบการรวมกัน ปรับปรุงประสิทธิภาพของแอปพลิเคชัน และสร้าง deployment pipelines ด้วย GitHub Actions",section1Content2:"ก่อนหน้านี้ ฉันได้เป็นผู้นำทีม front-end ระหว่างประเทศที่ Various Inc. โดยร่วมงานใกล้ชิดกับนักออกแบบเพื่อทำให้แอปพลิเคชันการสตรีมวิดีโอที่ใช้ JavaScript และ Perl เก่าให้ทันสมัย เราได้ย้ายแอปพลิเคชันเหล่านี้ไปยังสแต็ก React และ TypeScript ที่สามารถขยายได้และมีประสิทธิภาพสูง โดยใช้ Next.js, MOBX, WebSockets และ Python ซึ่งรองรับด้วย REST APIs และ CI/CD pipeline สำหรับการปรับใช้ที่ไร้รอยต่อ",section2Title:"ผู้นำทางเทคนิค",section2Content1:"ในการนำทีมระหว่างประเทศขนาดใหญ่ที่ครอบคลุมสหรัฐอเมริกา, ยุโรป, ไต้หวัน และจีน ฉันนำความเชี่ยวชาญลึกใน TypeScript, Node.js, PostgreSQL, Jest และ React เพื่อขับเคลื่อนนวัตกรรม นอกเหนือจากการออกแบบและพัฒนาเทคนิคแล้ว ทักษะการเป็นผู้นำของฉันยังทำให้ทีมทำงานได้ตรงตามเป้าหมายและมุ่งไปข้างหน้าอย่างมีประสิทธิภาพ"},about:{section1:"Brian เป็น Senior Developer ที่มีประสบการณ์และมีความหลงใหลในโค้ดที่สวยงามและสามารถขยายได้ และ UX ที่ใช้งานง่ายและตรงไปตรงมา",section2:"ในเวลาว่างเขาชอบปีนเขา เล่นหมากรุก ขี่จักรยานลุยและฝึกมวยไทย"},lang:{english:"อังกฤษ",chinese:"จีน",espanol:"สเปน",thai:"ไทย",german:"เยอรมัน",korean:"เกาหลี"},nav:{home:"หน้าหลัก",skills:"ทักษะ",projects:"โปรเจ็กต์",about:"เกี่ยวกับ",jobs:"งาน"},jobs:{content:{1:"",2:"",3:"",4:"",5:""}},data:{projects:{description:{1:"เครื่องมือซอฟต์แวร์สำหรับการทดลองทางคลินิกเพื่อการวางแผน ออกแบบ และปรับแต่งการศึกษาด้วยการวิเคราะห์แบบเรียลไทม์",2:"แอปพลิเคชันการสตรีมวิดีโอและแชทแบบเรียลไทม์",3:"เว็บไซต์สำรวจและข้อมูลเกี่ยวกับการเปลี่ยนแปลงที่จะเกิดขึ้นในเมือง San Anselmo",4:"เว็บไซต์สำหรับบริษัทออกแบบและพัฒนาเว็บไซต์",5:"Proof of concept Data Analytics micro-service app ที่สร้างใน Python และ Pandas",6:"การนำ Single Sign On ที่ไม่ผูกพันกับ IDP สำหรับแอปพลิเคชันการออกแบบการศึกษา",7:"เว็บไซต์สำหรับแอปพลิเคชัน AI ที่ใช้ในการจัดการรถยนต์มือสอง",8:"ส่วนหน้าสำหรับแอปพลิเคชันที่แสดงสำหรับแอปพลิเคชันทางเรขาคณิตในการรวมโครงสร้างลattice"},content:{1:"<div><h3>การใช้ AI ในการพัฒนาการศึกษาทางคลินิก</h3><p>ผลิตภัณฑ์หลักของบริษัท Faro Study Designer ถูกออกแบบมาเพื่อเพิ่มประสิทธิภาพและความสะดวกสบายในการใช้งานสำหรับโปรโตคอลทางคลินิก</p><p>Faro Health ได้รับการลงทุนจำนวนมาก โดยมีเงินทุนทั้งหมด $38.3 ล้านดอลลาร์ โดยเงินทุนล่าสุด $20 ล้านดอลลาร์ถูกระดมเมื่อประมาณสองปีที่แล้ว</p><p>คุณสมบัติหลัก ได้แก่:</p><ul><li>การทำงานร่วมกันแบบเรียลไทม์: ช่วยให้กระบวนการเอกสารแม่นยำและมีประสิทธิภาพ</li><li>การวิเคราะห์ความเป็นไปได้: ประเมินผลกระทบของการตัดสินใจออกแบบต่ออัตราความสำเร็จของการศึกษา</li><li>การเปรียบเทียบข้อมูล: เปรียบเทียบโปรโตคอลกับข้อมูลประวัติและการออกแบบที่แตกต่างกัน</li></ul></div>",2:"<p>The Viewer เป็นแพลตฟอร์มเว็บแคมที่ให้ผู้ใช้สามารถมีส่วนร่วมในการแชทสดกับผู้แสดง โดยให้ประสบการณ์ส่วนตัวแบบเรียลไทม์ แพลตฟอร์มนี้ช่วยให้ผู้ใช้สามารถดูการถ่ายทอดสด เข้าร่วมเซสชันส่วนตัว และเชื่อมต่อกับผู้แสดงผ่านวิดีโอ เสียง และฟีเจอร์แชท</p>",3:"<p>เว็บไซต์ WordPress สำหรับการอัปเดตแผนทั่วไป San Anselmo 2025 ซึ่งให้ข้อมูลครบถ้วนแก่ผู้อยู่อาศัยเกี่ยวกับการเปลี่ยนแปลงที่เสนอในโครงสร้างพื้นฐาน เขตการใช้ที่ดิน และพื้นที่สาธารณะของเมือง รวมถึงการอัปเดตโครงการต่างๆ ความยั่งยืน และการปรับปรุงการขนส่ง เว็บไซต์นี้ยังมีการสำรวจสาธารณะแบบโต้ตอบ ซึ่งให้ชุมชนมีส่วนร่วมในการตัดสินใจ</p>",4:"<p>Launch Brigade เป็นบริษัทออกแบบและพัฒนาเว็บไซต์ที่ตั้งอยู่ในพื้นที่อ่าวซานฟรานซิสโก ซึ่งเชี่ยวชาญในการสร้างประสบการณ์ดิจิทัลที่ยกระดับแบรนด์และส่งเสริมการเติบโตของธุรกิจ เว็บไซต์ของพวกเขาคือ launchbrigade.com ซึ่งสะท้อนถึงความมุ่งมั่นในการส่งมอบโซลูชันดิจิทัลที่ครบวงจร</p>",5:"<p>The Data Analytics Dashboard เป็นแอปพลิเคชัน proof of concept ที่สร้างใน Pandas ซึ่งใช้ข้อมูลการออกแบบการศึกษาใน star schema เพื่อสร้าง microservice ด้านการวิเคราะห์ข้อมูลและส่วนหน้าสำหรับผู้ใช้ในการจัดการข้อมูลการศึกษาของพวกเขาตามมิติข้อมูลที่เลือก</p>",6:"<p>การนำ Single Sign On ที่ไม่ผูกพันกับ IDP สำหรับแอปพลิเคชันการออกแบบการศึกษา ซึ่งสร้างขึ้นเพื่อให้องค์กรต่างๆ สามารถใช้บริการผู้ให้บริการตัวตน SAML และ Oauth ของตนเองในการให้โทเค็นเพื่อเชื่อมต่อกับ API ของเรา</p>",7:"<p>Lotlinx เป็นแพลตฟอร์มการจัดการสินค้าคงคลังรถยนต์ที่ขับเคลื่อนด้วย AI ซึ่งใช้การเรียนรู้ของเครื่องและการวิเคราะห์ข้อมูลเพื่อช่วยให้ตัวแทนจำหน่ายปรับปรุงการหมุนเวียนสินค้าคงคลังและความสามารถในการทำกำไร</p>",8:"<p>Metafold 3D เป็นแพลตฟอร์มบนคลาวด์ที่ช่วยให้การออกแบบและวิศวกรรมโมเดล 3 มิติที่ซับซ้อนได้ ซึ่งได้รับการปรับแต่งเพื่อการผลิตแบบเพิ่มขึ้น ก่อตั้งขึ้นในปี 2020 โดยผู้เชี่ยวชาญในสาขาคณิตศาสตร์ เรขาคณิต และสถาปัตยกรรม</p>"}},jobs:{title:{1:"Senior Full-Stack Developer",2:"Senior Lead Front-end Developer",3:"Front-end Developer",4:"Front-end Developer Intern",5:"Designer Intern"}}}},aD={translation:nD};ta.use(rE).init({resources:{en:YT,es:KT,zh:ZT,de:JT,ko:tD,th:aD},lng:"en",fallbackLng:"en",interpolation:{escapeValue:!1}});const iD=document.getElementById("root");document.querySelector("html").classList.add("theme-light");HS.createRoot(iD).render(G.jsx(tx,{router:AT}));
